"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Print name of USB port being used for serial communication</span></p></td></tr>\n"
