"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Fetch new laser stats.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">-update n</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Change frequency of automatic updates. Verdi GUI will automatically fetch new updates every n seconds.</span></p></td></tr></table>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:9pt;\"><br /></p>\n"
