"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:9pt; font-weight:600;\"><br /></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:9pt; font-weight:600;\"><br /></p>\n"
"<table border=\"1\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px;\" cellspacing=\"0\" cellpadding=\"0\"><thead>\n"
"<tr>\n"
"<td bgcolor=\"#f0f0f0\" style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt; font-weight:600; background-color:#f0f0f0;\">COMMAND</span><span style=\" font-size:9pt;\">        </span></p></td>\n"
"<td bgcolor=\"#f0f0f0\" style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt; font-weight:600; background-color:#f0f0f0;\">ACTION PERFORMED</span></p></td></tr></thead>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">BAUDRATE = n </span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Sets the RS-232 Serial port baud rate to the specified value. n = 1200, 2400, 4800, 9600, 19200, 38400, 57600        </span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">CHILLER</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Enables Coherent-supplied chiller</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">ECHO = n</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">If n = 0, turns echo OFF. Characters send to the laser will not be echoed to the host. If n = 1, turns echo ON. Changes in echo mode will take effect with the first command sent after the ECHO command.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">EXIT = 1</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Duplicates the exit button on the laser power source.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">FLASH = 1</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Flashes laser output below lasing threshold to allow single-frequency mode (etalon) to recenter.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">KNOBDN = 1</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Duplicates KNOB DOWN button.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">LASER = n</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Key must be in the &quot;ON&quot; position in the power supply. If n = 0, puts the laser in STANDBY mode. If n = 1, resets faults and turns the laser on. Lasing will resume if no active faults.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">LBOH = n</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">If n = 0, turns LBO heater off (cooldown). If n = 1, turns LBO heater on (heating).</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">LBOOPT</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Initiates LBO optimization.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">LIGHT = nn.nnnn</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Sets light regulation to the specified output power.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">LFP = n</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">If n = 0, enables user input from power supply front panel. If n = 0, disables user input from power supply front panel.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">MENUDN = 1</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Duplicates MENU DOWN button from front panel.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">SELECT = 1</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Duplicates MENU SELECT button.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">MENUUP = 1</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Duplicates MENU UP button.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">POWER = nn.nnnn</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Sets light regulation to the specified output power. Same as LIGHT = nn.nnnn</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">PROMPT = n</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">If n = 0, turns &quot;Verdi&gt;&quot; prompt off. If n = 1, turns &quot;Verdi&gt;&quot; prompt on.</span></p></td></tr>\n"
"<tr>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">SHUTTER = n</span></p></td>\n"
"<td style=\" padding-left:8; padding-right:8; padding-top:8; padding-bottom:8;\">\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">If n = 0, closes external shutter. If n = 1, opens external shutter.</span></p></td></tr></table>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:9pt;\"><br /></p>\n"
