"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Prints faults. See Laser Operator\'s Manual for list of fault codes.</span></p></td></tr>\n"
