"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:9pt;\">Returns list of numbered codes for all faults that have occurred since the last LASER ON command, separated by an &quot;&amp;&quot;, or return SYSTEM OK if no latched faults. To clear the fault screen, when the fault is active, enter the LASER ON or EXIT command.</span></p></td></tr>\n"
